import "./Home.css";
import React, { Component } from 'react';
import axios from 'axios';

class Home extends Component {
    render() {
        return (
        <div className="tv-1">
        <div className="tv-1-child">
        <h1 className="lets-get-you">Which page do you want to go?</h1>
        
        <button className="loginButton" onClick={this.handleSubmit}>
            <div className="login-wrapper">
            <div className="login">Login to existing Account.</div>
            </div>
        </button>
        <button className="signupbutton" onClick={this.handleSubmit}>
            <div className="signup-wrapper">
            <div className="signup">Create an Account</div>
            </div>
        </button>
        </div>
    </div> );
    }
}

export default Home
